import React, { useEffect } from 'react';
import Swiper from 'swiper';
import { Navigation, Pagination, Autoplay } from 'swiper/modules';
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import '../styles/HeroSlider.css';

const HeroSlider = () => {
  useEffect(() => {
    let swiper;
    const initializeSwiper = () => {
      swiper = new Swiper('.swiper-container', {
        modules: [Navigation, Pagination, Autoplay],
        slidesPerView: 1,
        spaceBetween: 30,
        loop: true,
        autoplay: {
          delay: 2500,
          disableOnInteraction: false,
        },
        pagination: {
          el: '.swiper-pagination',
          clickable: true,
        },
        navigation: {
          nextEl: '.swiper-button-next',
          prevEl: '.swiper-button-prev',
        },
      });
    };

    initializeSwiper();

    return () => {
      if (swiper) {
        swiper.destroy();
      }
    };
  }, []);

  return (
    <div className="hero-slider">
      <div className="swiper-container">
        <div className="swiper-wrapper">
          <div className="swiper-slide">
            <img src="/images/monterrey.webp" alt="Monterrey" style={{ width: '100%', height: 'auto' }} />
            <div className="slide-content">
              <h2>DESCUBRE TREND POR MEXICO</h2>
              <p>Guía turística, directorio comercial, eventos y mucho más</p>
            </div>
          </div>
          <div className="swiper-slide">
            <img src="https://via.placeholder.com/600x400/6c757d/FFFFFF?text=Guadalajara" alt="Guadalajara" style={{ width: '100%', height: 'auto' }} />
            <div className="slide-content">
              <h2>DESCUBRE TREND POR MEXICO</h2>
              <p>Guía turística, directorio comercial, eventos y mucho más</p>
            </div>
          </div>
          <div className="swiper-slide">
            <img src="https://via.placeholder.com/600x400/28a745/FFFFFF?text=CDMX" alt="CDMX" style={{ width: '100%', height: 'auto' }} />
            <div className="slide-content">
              <h2>DESCUBRE TREND POR MEXICO</h2>
              <p>Guía turística, directorio comercial, eventos y mucho más</p>
            </div>
          </div>
          <div className="swiper-slide">
            <img src="https://via.placeholder.com/600x400/dc3545/FFFFFF?text=Cancun" alt="Cancun" style={{ width: '100%', height: 'auto' }} />
            <div className="slide-content">
              <h2>DESCUBRE TREND POR MEXICO</h2>
              <p>Guía turística, directorio comercial, eventos y mucho más</p>
            </div>
          </div>
          <div className="swiper-slide">
            <img src="https://via.placeholder.com/600x400/ffc107/000000?text=Palenque" alt="Palenque" style={{ width: '100%', height: 'auto' }} />
            <div className="slide-content">
              <h2>DESCUBRE TREND POR MEXICO</h2>
              <p>Guía turística, directorio comercial, eventos y mucho más</p>
            </div>
          </div>
          <div className="swiper-slide">
            <img src="https://via.placeholder.com/600x400/17a2b8/FFFFFF?text=Puerto+Vallarta" alt="Puerto Vallarta" style={{ width: '100%', height: 'auto' }} />
            <div className="slide-content">
              <h2>DESCUBRE TREND POR MEXICO</h2>
              <p>Guía turística, directorio comercial, eventos y mucho más</p>
            </div>
          </div>
          <div className="swiper-slide">
            <img src="https://via.placeholder.com/600x400/fd7e14/FFFFFF?text=Veracruz" alt="Veracruz" style={{ width: '100%', height: 'auto' }} />
            <div className="slide-content">
              <h2>DESCUBRE TREND POR MEXICO</h2>
              <p>Guía turística, directorio comercial, eventos y mucho más</p>
            </div>
          </div>
        </div>
        <div className="swiper-pagination"></div>
        <div className="swiper-button-prev"></div>
        <div className="swiper-button-next"></div>
        <div className="buttons">
          <button className="explorar-button" onClick={() => alert('Scroll to categories')}>Explorar</button>
          <button className="cerca-de-mi-button" onClick={() => alert('Request user location')}>Cerca de mí</button>
        </div>
      </div>
    </div>
  );
};

export default HeroSlider;
